                <div><h4 className="card-title">
                    Appointments
                </h4>
                    <div style={{float: "left" }}>
                    Search:
                        <input type='text' 
                               value={searchText} 
                               onChange={onSearch}/>
                        <br></br>
                    </div></div>
                <div>
                    <br></br>
                    {console.log(appointments)}
                    <div className="table table-table-responsive">
                        <table className="table table-hover">
                            <thead>
                                <tr>
                                    <td>
                                        Id
                                    </td>
                                    <td>
                                        patient Name
                                    </td>
                                    <td>
                                        Appointment Date
                                    </td>
                                    <td>
                                        Status
                                    </td>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    appointments.map((appointment) => {

                                        if(searchText!="")
                                        {
                                        if(appointment.patientname.toLowerCase().
                                        includes(searchText.toLowerCase())||appointment.appoint.toLowerCase().
                                        includes(searchText.toLowerCase()))
                                        {
                                            return <AppointmentsRow  key={appointment.id} 
                                            appointment={appointment}
                                            cancel={cancel}
                                            attend={attend}
                                            Bill={Bill}
                                            confirm={confirm}
                                            />
                                        }
                                        else
                                        {
                                            return;
                                        }
                                      }
                                      else
                                      {
                                        return <AppointmentsRow  key={appointment.id} 
                                            appointment={appointment}
                                            cancel={cancel}
                                            attend={attend}
                                            Bill={Bill}
                                            confirm={confirm}
                                            />
                                      }



                                        // return <tr key={appointment.id}>
